import React from "react";
import walkingMan from "./media/sapiens(1).png";

function App() {
  return (
    <div className="bg-black min-h-screen mx-auto p-10 flex text-center items-center justify-center align-items">
      <div className="flex grid grid-cols-2">
        <div>
          <img src={walkingMan} alt="Walking man" />
        </div>
        <div>
          <div className="text-white font-light uppercase tracking-widest text-xl">
            Coming soon
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
